class Home extends Component {



  render(){
    return (
      <h1>
          hi {this.props.dummy} kak si
      </h1>

    );
  }
}

function mapStateToProps(state){
  const dummy = state.user.dummy;

  return {dummy};
}

export default connect(mapStateToProps)(Home);
